           // variables used by bootstrap\n@import \'~@sebgroup/fonts/scss/seb-fonts\';                  // import seb font\n@import "~@sebgroup/bootstrap/scss/styles/functions";       // functions used by bootstrap\n@import "~@sebgroup/bootstrap/scss/styles/mixins/mixins";   // mixins used by bootstrap\n@import "~@sebgroup/bootstrap/scss/styles/reboot";          // reset browser specific styles (based on normalize.css)\n@import "~@sebgroup/bootstrap/scss/styles/buttons";         // specific styles for buttons\n```\n\nWhy not just import buttons? Well in order for the styles to build we need include some common variables, functions and mixins too, but don\'t worry these won\'t add size to the final output.\n\n## Base state\nThis is the default state of the component\n```html\n      <button type="button" class="btn btn-primary">Primary</button>\n      <button type="button" class="btn btn-outline-primary">Primary outline</button>\n      <button type="button" class="btn btn-secondary">Secondary</button>\n      <button type="button" class="btn btn-link">Link</button>\n```\n\n## Disabled state\nThis is the disabled state of the component\n```html\n      <button type="button" class="btn btn-primary disabled">Primary</button>\n      <button type="button" class="btn btn-outline-primary disabled">Primary outline</button>\n      <button type="button" class="btn btn-secondary disabled">Secondary</button>\n      <button type="button" class="btn btn-link disabled">Link</button>\n```'},F92I:function(n,t){n.exports='<a name="buttons"><h2 class="my-3">Animations</h2></a>\n<app-include [components]="components"></app-include>\n<div class="card mx-n3 mx-sm-0 mb-4">\n  <app-anchor-heading heading="Animations"></app-anchor-heading>\n  <div class="card-body">\n    <p>Once the animations mixin has been imported you can add animations like this in your scss file:<br>\n      <code>@include add-transition(\'fadeIn\');</code></p>\n    E.g.<br>\n    <code>\n      .fade-in-element {{\'{\'}}\n      @include add-transition(\'fadeIn\');\n      {{\'}\'}}\n    </code>\n    <p class="mt-3">Below is a list of animations currently available.</p>\n    <table class="table">\n      <tr>\n        <th>Animation</th>\n        <th>Usage</th>\n      </tr>\n      <tr *ngFor="let animation of animations">\n        <td>{{animation.name | titlecase}}</td>\n        <td><code>@include add-transition(\'{{animation.importName}}\');</code></td>\n      </tr>\n    </table>\n    <h4>Demo</h4>\n    <p>Hover "buttons" to show animation.</p>\n    <div class="row">\n      <ng-container *ngFor="let animation of animations">\n        <div class="col-12 col-sm-6 col-md-3">\n          <button class="btn btn-sm btn-dark">{{animation.name}}</button>\n          <div class="animation-wrapper mt-3">\n            <div class="bg-primary animate-example animate-{{animation.class}}"></div>\n          </div>\n        </div>\n      </ng-container>\n    </div>\n  </div>\n</div>\n'},FBIH:function(n,t){n.exports='<a name="buttons"><h2 class="my-3">Buttons</h2></a>\n<app-include [components]="components"></app-include>\n<div class="card mb-4 mx-n3 mx-md-0" id="buttonsExample">\n  <h4 class="card-header">Button styles and modifiers</h4>\n  <div class="card-body">\n    <p>Bootstrap have a few different modifiers that can be used with buttons, we primarily use <code>.btn-primary</code>, <code>.btn-secondary</code> and <code>.btn-link</code>, use the latter to give buttons the same behavior as normal links (used for links placed outside text segments and paragraphs as well as actions similar to "go to" or regular links). You can also use the outline version if you want an "inverted" button with border. Note that we only support <code>.btn-primary</code>,<code>.btn-secondary</code>,<code>.btn-light</code>,<code>.btn-danger</code> and <code>.btn-dark</code> from bootstrap, if you use any of the others they will fall back to the primary style.</p>\n    <label class="d-block">Standard</label>\n    <button type="button" class="btn btn-primary">Primary</button>\n    <button type="button" class="btn btn-danger">Danger (delete)</button>\n    <button type="button" class="btn btn-secondary">Secondary</button>\n    <button type="button" class="btn btn-link">Link</button>\n    <label class="d-block mt-3">Outlined</label>\n    <button type="button" class="btn btn-outline-primary">Primary outlined</button>\n    <button type="button" class="btn btn-outline-danger">Danger outlined</button>\n    <button type="button" class="btn btn-outline-danger border-transparent">Danger without border</button>\n    <label class="d-block mt-3">Disabled</label>\n    <button type="button" class="btn btn-primary disabled">Primary</button>\n    <button type="button" class="btn btn-outline-primary disabled">Primary outlined</button>\n    <button type="button" class="btn btn-secondary disabled">Secondary</button>\n    <button type="button" class="btn btn-link disabled">Link</button>\n    \x3c!--<exemplify [selector]="\'#buttonsExample .btn:not(.disabled)\'"></exemplify>--\x3e\n    <h4 class="card-header mt-3">Close button</h4>\n    <div class="card-body" id="buttonCloseExample">\n      <p>Add <code>.close</code> to a button to get correct style and icon for a close button. The button will be right aligned by default. Use inside modals and other components that can be closed.</p>\n      <button type="button" class="close" aria-label="Close">\n        <span aria-hidden="true">&times;</span>\n      </button>\n      \x3c!--<exemplify [selector]="\'#buttonCloseExample .close\'"></exemplify>--\x3e\n    </div>\n  </div>\n</div>\n<div class="card mb-4 mx-n3 mx-md-0">\n\n</div>\n<div class="card mb-4 mx-n3 mx-md-0" id="buttonsLightExample">\n  <h4 class="card-header">Buttons and colored backgrounds</h4>\n  <div class="card-body">\n    <p>The <code>.btn-light</code> and <code>.btn-dark</code> classes should only be used when buttons are placed on colored or dark backgrounds/images.</p>\n    <div class="row align-items-center no-gutters">\n      <div class="col-6 col-md-4 col-lg bg-primary-element py-4 text-center">\n        <button class="btn btn-light">Light</button>\n      </div>\n      <div class="col-6 col-md-4 col-lg bg-info-element py-4 text-center">\n        <button class="btn btn-light">Light</button>\n      </div>\n      <div class="col-6 col-md-4 col-lg bg-success-element py-4 text-center">\n        <button class="btn btn-light">Light</button>\n      </div>\n      <div class="col-6 col-md-4 col-lg bg-warning-element py-4 text-center">\n        <button class="btn btn-dark">Dark</button>\n      </div>\n      <div class="col-6 col-md-4 col-lg bg-danger-element py-4 text-center">\n        <button class="btn btn-light">Light</button>\n      </div>\n      <div class="col-6 col-md-4 col-lg bg-secondary-element py-4 text-center">\n        <button class="btn btn-dark">Dark</button>\n      </div>\n    </div>\n  </div>\n</div>\n<div class="card mb-4 mx-n3 mx-md-0" id="buttonsGridExample">\n  <h4 class="card-header">Responsive design and buttons</h4>\n  <div class="card-body">\n    <p>If you look at the example above on smaller screen you\'ll notice that the buttons won\'t stack nicely. To have full control and to create a good experience on mobile devices and tablets consider placing buttons in a grid.</p>\n    <div class="row no-gutters">\n      <div class="col-12 col-sm-4 col-md-auto mb-3 mb-md-0 pr-sm-2 pr-md-0">\n        <button type="button" class="btn btn-primary w-100"><span class="d-sm-none">100% (col-12)</span><span class="d-none d-sm-block d-md-none">1/3 (col-sm-4)</span><span class="d-none d-md-block">col-md-auto</span></button>\n      </div>\n      <div class="col-6 col-sm-4 col-md-auto mb-3 mb-md-0 pr-2 px-sm-2 px-md-3">\n        <button type="button" class="btn btn-primary w-100"><span class="d-sm-none">50% (col-6)</span><span class="d-none d-sm-block d-md-none">1/3 (col-sm-4)</span><span class="d-none d-md-block">col-md-auto</span></button>\n      </div>\n      <div class="col-6 col-sm-4 col-md-auto mb-3 mb-md-0 pl-2 pl-md-0">\n        <button type="button" class="btn btn-primary w-100"><span class="d-sm-none">50% (col-6)</span><span class="d-none d-sm-block d-md-none">1/3 (col-sm-4)</span><span class="d-none d-md-block">col-md-auto</span></button>\n      </div>\n      <div class="col col-sm-4 col-md-auto mb-3 mb-md-0 pr-2 px-md-3">\n        <button type="button" class="btn btn-primary w-100"><span class="d-sm-none">1/3 (col)</span><span class="d-none d-sm-block d-md-none">1/3 (col-sm-4)</span><span class="d-none d-md-block">col-md-auto</span></button>\n      </div>\n      <div class="col col-sm-4 col-md-auto mb-3 mb-md-0 px-2 pl-md-0">\n        <button type="button" class="btn btn-primary w-100"><span class="d-sm-none">1/3 (col)</span><span class="d-none d-sm-block d-md-none">1/3 (col-sm-4)</span><span class="d-none d-md-block">col-md-auto</span></button>\n      </div>\n      <div class="col col-sm-4 col-md-auto mb-3 mb-md-0 pl-2">\n        <button type="button" class="btn btn-primary w-100"><span class="d-sm-none">1/3 (col)</span><span class="d-none d-sm-block d-md-none">1/3 (col-sm-4)</span><span class="d-none d-md-block">col-md-auto</span></button>\n      </div>\n    </div>\n    \x3c!--<exemplify [selector]="\'#buttonsGridExample .card-body > .row\'"></exemplify>--\x3e\n  </div>\n</div>\n<div class="card mb-4 mx-n3 mx-md-0" id="buttonsIconExample">\n  <h4 class="card-header">Icons in buttons</h4>\n  <div class="card-body">\n    <p>Example with icon, note the alignment on mobile devices (smaller screens) using a grid.</p>\n    <div class="row no-gutters">\n      <div class="col-12 col-sm-auto">\n        <button type="button" class="btn btn-primary w-100">\n          <div class="row no-gutters">\n            <div class="col text-left">Go to next page</div>\n            <div class="col-auto ml-sm-2"><i class="far fa-arrow-right"></i></div>\n          </div>\n        </button>\n      </div>\n    </div>\n    \x3c!--<exemplif